             ['Nervous system',
              u'Huvudv\xe4rk, s\xf6mnst\xf6rningar (t ex abnorma dr\xf6mmar, s\xf6mnl\xf6shet), yrsel, anorexi, tr\xf6tthet (t ex somnolens, d\xe5sighet), eufori, onormala r\xf6relser med kort varaktighet (t ex muskelryckning, ataxi, tremor, myoklonus), kramper och psykomotorisk oro. Hallucinationer, manisk reaktion, f\xf6rvirring, agitation, oro och besl\xe4ktade symtom (t ex nervositet), f\xf6rs\xe4mrad koncentrationsf\xf6rm\xe5ga och tankeprocess (t ex depersonalisering), panikattacker (dessa symtom kan bero p\xe5 den bakomliggande sjukdomen). Mycket s\xe4llsynt \xe4r serotonergt syndrom.'],
             ['Renal', u'Urinretention och t\xe4ta urint\xf6mningar.'],
             ['Reproductive system',
              u'Sexuell dysfunktion (ejakulationsst\xf6rningar, anorgasm), priapism, galaktorr\xe9. \xd6vrigt Alopeci, g\xe4spningar, synst\xf6rningar (t ex dimsyn, mydriasis), svettningar, vasodilatation, artralgi, myalgi, postural hypotoni, bl\xf6dningar i huden (ekkymos). Andra bl\xf6dningar (t ex gynekologiska bl\xf6dningar, gastrointestinala bl\xf6dningar och andra hud- eller slemhinnebl\xf6dningar) har s\xe4llsynt rapporterats (se 4.4 F\xf6rsiktighetsm\xe5tt, Bl\xf6dningar). Epidemiologiska studier som fr\xe4mst har utf\xf6rts p\xe5 patienter 50 \xe5r och \xe4ldre, visar en \xf6kad risk f\xf6r benfraktur hos patienter som behandlas med SSRI och TCA. Mekanismen \xe4r ok\xe4nd. Hyponatremi Hyponatremi (innefattande serumnatrium mindre \xe4n 110 mmol/l) har rapporterats s\xe4llsynt och f\xf6refaller vara reversibel d\xe5 fluoxetin uts\xe4tts. N\xe5gra fall beror sannolikt p\xe5 otillr\xe4cklig uts\xf6ndring av antidiuretiskt hormon. Flertalet av rapporterna h\xe4rr\xf6rde fr\xe5n \xe4ldre patienter och patienter som fick diuretika eller hade v\xe4tskebrist av annan anledning.'],
